import React, { useState, useEffect } from "react";
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Axios from 'axios';


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});



// function createData(name, calories, fat, carbs, protein) {
//   return { name, calories, fat, carbs, protein };
// }

// const rows = [
//   createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
//   createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
//   createData('Eclair', 262, 16.0, 24, 6.0),
//   createData('Cupcake', 305, 3.7, 67, 4.3),
//   createData('Gingerbread', 356, 16.0, 49, 3.9),
// ];

export default function BasicTable() {
    const classes = useStyles();
    const [playerData, setPlayerData] = useState([]);

    useEffect(() => {
        Axios.get('http://localhost:3002/api/player_data').then((response) => {
            console.log("Data entered")
            setPlayerData(response.data)
        })
    }, [])
    // console.log(playerData);
    return (
        <TableContainer component={Paper}>
        <Table className={classes.table} aria-label="simple table">
            <TableHead>
            <TableRow>
                <TableCell>Name</TableCell>
                <TableCell align="right">Salary</TableCell>
                <TableCell align="right">Position</TableCell>
                <TableCell align="right">Accolades</TableCell>
                <TableCell align="right">Experience</TableCell>
            </TableRow>
            </TableHead>
            <TableBody>
            {playerData.map((val) => (
                <TableRow key={playerData.Name}>
                <TableCell component="th" scope="row">
                    {playerData.Name}
                </TableCell>
                <TableCell align="right">{playerData.Salary}</TableCell>
                <TableCell align="right">{playerData.Position}</TableCell>
                <TableCell align="right">{playerData.Accolades}</TableCell>
                <TableCell align="right">{playerData.Team}</TableCell>
                </TableRow>
            ))}
            </TableBody>
        </Table>
        </TableContainer>
    );
}
